function Subtotal(){
  var b1=Number(document.getElementById('a1').value);
  var b2=Number(document.getElementById('a2').value);
  var b3=Number(document.getElementById('a3').value);
  var b4=Number(document.getElementById('a4').value);
  var b5=Number(document.getElementById('a5').value);
  var b6=Number(document.getElementById('a6').value);
  var b7=Number(document.getElementById('a7').value);
  var b8=Number(document.getElementById('a8').value);
  var b9=Number(document.getElementById('a9').value);
  var b10=Number(document.getElementById('a10').value);
  var b11=Number(document.getElementById('a11').value);
  var b12=Number(document.getElementById('a12').value);

  document.getElementById('val').value=b1+b2+b3+b4+b5+b6+b7+b8+b9+b10+b11+b12;
  var sub=document.getElementById('val').value;
  var bal=document.getElementById('bal').value;
  var tot=sub-bal;

    document.getElementById('total').value=tot+"/- Rs.";

}

